import { Route } from '@angular/router';
import { LoginComponent } from './auth/login.component';

export const appRoutes: Route[] = [
  { path: 'login', component: LoginComponent },
  { path: '', pathMatch: 'full', redirectTo: 'login' },
  { path: '**', redirectTo: 'login' },
];
